function qrCodePage_js() {
    /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'homeButton': 'qrCodePage_homeButton',
        'ownerNameLabel': 'qrCodePage_ownerNameLabel',
        'qrImage': 'qrCodePage_qrImage',
        'qrcodeDownload': 'qrCodePage_qrcodeDownload',
        'html_3': 'qrCodePage_html_3',
        'menuUrl': 'qrCodePage_menuUrl',
        'urlCopiedLabel': 'qrCodePage_urlCopiedLabel'
    };
    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }
    /*
     * Nonvisual components
     */
    Apperyio.mappings = Apperyio.mappings || {};
    Apperyio.mappings["qrCodePage_qrCodePage_onload_mapping_1"] = {
        "homeScreen": "qrCodePage",
        "directions": [
            {
                "from_name": "currentVendor",
                "from_type": "SESSION_STORAGE",
                "to_name": "qrCodePage",
                "to_type": "UI",
                "mappings": [
                    {
                        "source": "$['businessName']",
                        "target": "$['ownerNameLabel:text']"
                    }
                ]
            }
        ]
    };
    Apperyio.datasources = Apperyio.datasources || {};
    Apperyio.CurrentScreen = 'qrCodePage';
    _.chain(Apperyio.mappings)
        .filter(function(m) {
            return m.homeScreen === Apperyio.CurrentScreen;
        })
        .each(Apperyio.UIHandler.hideTemplateComponents);
    /*
     * Events and handlers
     */
    // On Load
    var qrCodePage_onLoad = function() {
        qrCodePage_elementsExtraJS();
        var generatorUrl = 'https://api.qrserver.com/v1/create-qr-code/?size=120x120&data=',
            //url = 'https://appery.io/app/view/6f6b5cb3-e481-4b12-be3f-dd8cecd1ca07/app/startScreen.html?vendor=' 
            url = 'https://knowye.app.appery.io/app/startScreen.html?vendor=' + projectMdb1_settings.vendor_id;
        finalUrl = generatorUrl + encodeURIComponent(url);
        Apperyio('menuUrl').prop('href', url);
        Apperyio('qrImage').find('img').prop('src', finalUrl);
        Apperyio('qrcodeDownload').find('a').prop('href', finalUrl);
        /*
        var clipboard = new Clipboard('.clipboard-btn',{
            text: function(trigger) {
                return url;
            }
        });

        clipboard.on('success', function(e) {
            showPopupWithTimout('confirmCopyPopup', confirmCopyPopupTime);
            e.clearSelection();
        });

        clipboard.on('error', function(e) {
            console.error('Trigger:', e.trigger);
        });
        */
        ;
        Apperyio.processMappingAction(Apperyio.mappings["qrCodePage_qrCodePage_onload_mapping_1"]);
        qrCodePage_deviceEvents();
        qrCodePage_windowEvents();
        qrCodePage_elementsEvents();
    };
    // screen window events
    function qrCodePage_windowEvents() {
        $('#qrCodePage').bind('pageshow orientationchange', function() {
            var _page = this;
            adjustContentHeightWithPadding(_page);
        });
    };
    // device events
    function qrCodePage_deviceEvents() {
        document.addEventListener("deviceready", function() {
        });
    };
    // screen elements extra js
    function qrCodePage_elementsExtraJS() {
        // screen (qrCodePage) extra code
        /* confirmCopyPopup */
        $("#qrCodePage_confirmCopyPopup").popup("option", "positionTo", "window");
    };
    // screen elements handler
    function qrCodePage_elementsEvents() {
        $(document).on("click", "a :input,a a,a fieldset label", function(event) {
            event.stopPropagation();
        });
        $(document).off("click", '#qrCodePage_qrCodePageHeader [name="homeButton"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('proprietorStartPage', {
                        transition: 'slidedown',
                        reverse: false
                    });
                }
            },
        }, '#qrCodePage_qrCodePageHeader [name="homeButton"]');
        $(document).off("taphold", '#qrCodePage_qrCodePageContainer [name="menuUrl"]').on({
            taphold: function(event) { //Apperyio('clipboardBtn').click();
                //$(".clipboard-btn").click();
                if (isPhone) {
                    copy('https://appery.io/app/view/6f6b5cb3-e481-4b12-be3f-dd8cecd1ca07/startScreen.html?vendor=' + projectMdb1_settings.vendor_id);
                    return false;
                }
                //$(".clipboard-btn").click();
                ;
            },
        }, '#qrCodePage_qrCodePageContainer [name="menuUrl"]');
    };
    $(document).off("pagebeforeshow", "#qrCodePage").on("pagebeforeshow", "#qrCodePage", function(event, ui) {
        Apperyio.CurrentScreen = "qrCodePage";
        _.chain(Apperyio.mappings)
            .filter(function(m) {
                return m.homeScreen === Apperyio.CurrentScreen;
            })
            .each(Apperyio.UIHandler.hideTemplateComponents);
    });
    qrCodePage_onLoad();
};
$(document).off("pagecreate", "#qrCodePage").on("pagecreate", "#qrCodePage", function(event, ui) {
    Apperyio.processSelectMenu($(this));
    qrCodePage_js();
});